import { SwipeableDrawer } from '@material-ui/core';
import React, {useState} from 'react'
import TinderCard from 'react-tinder-card';
import './TinderCards.css';

function TinderCards() {
    const[people, setPeople] = useState([
        {
            name: 'Elon Musk',
            url: "https://static.theceomagazine.net/wp-content/uploads/2018/10/15093202/elon-musk.jpg"
        },
        {
            name: 'Jeff Bezos',
            url: "https://image.cnbcfm.com/api/v1/image/105815446-1553624918736gettyimages-1078542150.jpeg?v=1612303414"
        },
        {
            name: 'Jennifer Lawrence',
            url: "https://www.stuttgarter-nachrichten.de/media.media.b9d654b7-ac85-4373-a147-1a332bee6978.original1024.jpg"
        }
    ]);

    const swiped = (direction, nameToDelete) => {
        console.log("Removing: " + nameToDelete);
        //setLastDirection(direction);
    };

    const outOfFrame = (name) => {
        console.log(name + " left the screen!");
    };

    return (
        <div className="tinderCards">
            <div className="tinderCards__cardContainer">
                {people.map((person) => (
                    // TinderCard is a library with Node.js
                    <TinderCard
                        className="swipe"
                        key={person.name}
                        preventSwipe={["up","down"]}
                        onSwipe={(dir) => swiped(dir, person.name)}
                        onCardLeftScreen={() => outOfFrame(person.name)}
                    >
                        <div
                            className="card" 
                            style={{ backgroundImage: 'url(' + person.url + ')'}}
                        >
                            <h3>{person.name}</h3>
                        </div>
                    </TinderCard>
                ))}
            </div>
        </div>
    );
}

export default TinderCards

